import java.util.*;

/**
 * Created by ljx on 17-7-19.
 *
 * Given two strings s and t, write a function to determine if t is an anagram of s.

   For example,
     s = "anagram", t = "nagaram", return true.
     s = "rat", t = "car", return false.

   Note:
     You may assume the string contains only lowercase alphabets.
 */
public class Valid_Anagram_242 {

    public static void main(String[] args) {
        Valid_Anagram_242 va = new Valid_Anagram_242();
        String s1 = "";
        String s2 = "";
        boolean b = va.isAnagram_2(s1, s2);
        System.out.println(b);
    }

    /**
     * 这种方法为什么不对？
     */
    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length())
            return false;
        Map<Character, Integer> charMap_1 = new HashMap<>();
        Map<Character, Integer> charMap_2 = new HashMap<>();
        for (int i=0; i<s.length(); ++i) {
            charMap_1.put(s.charAt(i), 1 + charMap_1.getOrDefault(s.charAt(i), 0));
            charMap_2.put(t.charAt(i), 1 + charMap_2.getOrDefault(t.charAt(i), 0));
        }
        for (char c : charMap_1.keySet()) {
            if (!charMap_2.containsKey(c) || charMap_1.get(c)!=charMap_2.get(c))
                return false;
        }
        return true;
    }

    public boolean isAnagram_2(String s, String t) {
        int[] alphabet = new int[26];
        for (int i = 0; i < s.length(); i++) alphabet[s.charAt(i) - 'a']++;
        for (int i = 0; i < t.length(); i++) alphabet[t.charAt(i) - 'a']--;
        for (int i : alphabet) if (i != 0) return false;
        return true;
    }

}
